// DogRunPage.tsx
import React from "react";


const DogRunInfo: React.FC = () => <div>Dog Run Info</div>;
const DogRunGallery: React.FC = () => <div>Dog Run Gallery</div>;

const DogRunPage: React.FC = () => {
  return (
    <div>
      <h2>全国のドッグランを検索</h2>
      <nav>
        <Link to="info">Info</Link> | <Link to="gallery">Gallery</Link>
      </nav>

      {/* DogRunPage 内のルーティング設定 */}
      <Routes>
        <Route path="info" element={<DogRunInfo />} />
        <Route path="gallery" element={<DogRunGallery />} />
      </Routes>
    </div>
  );
};

export default DogRunPage;
